import React, { Component } from "react";
import Base from "../core/Base";

export default class chumma extends Component {
  constructor(props) {
    super(props);
    this.state = {
      radio: "",
    };
  }
  activity = () => {
    return (
      <div>
        <h4>
          Select Task :{" "}
          <input
            type="radio"
            value="activity"
            name="radio"
            onChange={this.setState({ radio: "activity" })}
          />
          activity
          <input
            className="ml-3"
            type="radio"
            value="waiting"
            name="radio"
            onChange={this.setState({ radio: "waiting" })}
          />
          waiting
        </h4>
        <h3>Selected is :{this.state.radio}</h3>
      </div>
    );
  };

  render() {
    return (
      <Base title="" description="" className="container bg-light p-4">
        <div className="text-center">{this.activity()}</div>
      </Base>
    );
  }
}
